INSERT INTO `ps_category_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Strona główna','','strona-glowna','','',''),(3,1,1,'lampy wiszace','Lampy wiszące zawsze odpowiadające obowiązującym trendom w zakresie oświetlania i aranżacji wnętrz. Nowoczesne lampy - geometryczne, utrzymane w stylu industrialnym, w eleganckim kolorze miedzi (idealne do kuchni), albo klasyczne – tradycyjny pojedynczy klosz. Modne i imponujące jakością - takie są właśnie lampy, jakie znajdziesz w ofercie naszego sklepu! Proponujemy bogaty wybór oświetlenia idealnego do salonu, kuchni, jadalni, czy też sypialni. Dla pełnej przyjemności wyboru i zakupów w naszym sklepie proponujemy także atrakcyjne ceny i wygodę zamówień online. Po prostu wybierz lampę, jaka odpowiada Ci najbardziej, a my zadbamy o to, by bezpiecznie i szybko dotarła pod wskazany przez Ciebie adres!','lampy-wiszace','','',''),(4,1,1,'lampy sufitowe','Lampy sufitowe - zarówno nowoczesne plafony o minimalistycznym designie, jak i efektowne, bogato zdobione i szalenie eleganckie żyrandole - to nasza specjalność. Dlatego wśród naszych propozycji znajdziesz lampę, która Cię oczaruje i doda wybranej przestrzeni zupełnie nowego charakteru oraz niepowtarzalnego stylu. Komponując ofertę, sięgnęliśmy po najpiękniejsze lampy sufitowe, które poza oryginalnym designem stanowią funkcjonalne rozwiązania w zakresie oświetlenia wnętrz. Wszystko to w połączeniu z komfortem zamówień online oraz atrakcyjnymi cenami sprawia, że zakupy stają się prawdziwą przyjemnością! Wybierz nowoczesny plafon sufitowy lub elegancką lampę wiszącą i zamów wygodnie w naszym sklepie, a my zadbamy o to, aby wybrany asortyment bezpiecznie i szybko dotarł pod wskazany przez Ciebie adres. Szukasz wyjątkowej lampy sufitowej? Jesteśmy przekonani, że w naszej bogatej ofercie znajdziesz lampę, która spełni wszystkie Twoje oczekiwania!','lampy-sufitowe','','',''),(5,1,1,'kinkiety','Nowoczesne kinkiety - efektowne i o oryginalnym designie, niezależnie od stylu. Perfekcyjnie wykonane, energooszczędne (kinkiety LED) i tym samym przyjazne nie tylko domowemu budżetowi, ale i środowisku naturalnemu. Jednocześnie funkcjonalne i wygodne w codziennym użytkowaniu. Rozwiązanie idealne? Zdecydowanie tak!','kinkiety','','',''),(6,1,1,'lampy stolowe','Lampa stołowa, która nie tylko w funkcjonalny sposób doświetli przestrzeń, ale i stanowić będzie oryginalną ozdobę wnętrza? Tutaj z pewnością ją znajdziesz! Proponujemy bogaty wybór lamp o zróżnicowanym designie, idealnych zarówno dla nowoczesnych, jak i klasycznych aranżacji, funkcjonalnych i wygodnych w użytkowaniu. Lampa stołowa będzie doskonałym rozwiązaniem nie tylko na stół czy stolik, ale także na szafkę nocną, biurko i komodę. Nie musisz wybierać między walorami dekoracyjnymi a funkcjonalnością. Oferujemy lampy stołowe, które są piękne i praktyczne zarazem! Każda nasza propozycja to także atrakcyjna cena oraz wygoda zakupów realizowanych online. Nie spiesz się! Przeglądaj swobodnie nasze lampy stołowe i sięgnij po model, który odpowiada Ci najbardziej. My zadbamy o to, aby wybrana lampka szybko i bezpiecznie została dostarczona pod wskazany przez Ciebie adres. Najpiękniejsze wzornictwo, najwyższa jakość, najlepsi producenci - wszystko to masz teraz na wyciągnięcie ręki w najlepszej cenie. Poznaj nasze lampy stołowe!','lampy-stolowe','','',''),(7,1,1,'led','Lampy LEDowe to dziś jedno z ciekawszych rozwiązań, jeśli chodzi o nowoczesne oświetlenie. Z całą pewnością posiada ono wiele zalet - żarówki LED są energooszczędne, ekologiczne, bezawaryjne i wytrzymałe. Generują przy tym przyjemne i przytulne światło, które nie męczy wzroku. Dlatego koniecznie poznaj naszą bogatą ofertę nowoczesnego oświetlenia LED!','led','','',''),(8,1,1,'lampy podlogowe','Jeśli szukasz klimatycznego oświetlenia, które będzie jednocześnie ozdobą pokoju – postaw na designerskie lampy stojące. Te wyjątkowe źródła światła potrafią nadać każdemu wnętrzu przytulności i domowego klimatu. W naszym sklepie znajdziesz bogatą i zróżnicowaną ofertę lamp podłogowych, dzięki czemu łatwo wybierzesz model, który wpasuje się w Twoje gusta i charakter pomieszczenia.','lampy-podlogowe','','',''),(9,1,1,'oprawy listwy oswietleniowe','Listwy oświetleniowe to coraz chętniej wybierane rozwiązanie, które sprawdzi się w każdym pomieszczeniu. Podkreśla nowoczesny wystrój wnętrza, gwarantuje jasne, równomierne oświetlenie i jest idealne dla niskich pomieszczeń. To tylko część zalet montażu listwy sufitowej. Sprawdź naszą ofertę i wybierz model, który będzie idealny do Twojego wnętrza.','oprawy-listwy-oswietleniowe','','',''),(10,1,1,'oprawy stropowe','Klimatyczne światło, nowoczesny design i liczne modele do wyboru – oprawa stropowa znajduje wszechstronne zastosowanie w wielu wnętrzach. W naszej ofercie znajdą Państwo szeroką kolekcję opraw, wśród których można wybrać dowolny kształt, kolor czy wielkość lampy. Jeśli więc szukają Państwo nowoczesnego rozwiązania do swojego domu, koniecznie przejrzyjcie ofertę opraw stropowych!','oprawy-stropowe','','',''),(11,1,1,'lampy dla dzieci','Dobre oświetlenie dla dzieci to bez wątpienia kluczowa sprawa podczas urządzania pokoju Twojego dziecka. Lampy dziecięce powinny być nie tylko funkcjonalne i przyjazne w użytkowaniu, ale także muszą tworzyć przytulny klimat w pokojach najmłodszych. Z myślą o szczególnych potrzebach aranżacji pokoi dziecięcych, przedstawiamy starannie wyselekcjonowaną kolekcję lamp dla dzieci, w tym także nowoczesne modele LED.','lampy-dla-dzieci','','',''),(12,1,1,'systemy linkowe','','systemy-linkowe','','',''),(13,1,1,'lampy ogrodowe','Lampy ogrodowe podnoszą walory estetyczne ogrodu, tarasu, podjazdu, a dodatkowo wpływają na poprawę bezpieczeństwa po zmierzchu. Nowoczesne lampy ogrodowe są odporne na niekorzystne warunki atmosferyczne, a dostępność różnorodnych wzorów sprawia, że każdy znajdzie model dopasowany do aranżacji przestrzeni na zewnątrz. W naszej ofercie znajdują się kinkiety, kule i kwadraty stojące, projektory, oprawy najazdowe czy lampy stojące i wiszące.','lampy-ogrodowe','','','');
/*!40000 ALTER TABLE `ps_category_lang` ENABLE KEYS */;
UNLOCK TABLES;

