INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','Nasze zasady i warunki dostawy','conditions, delivery, delay, shipment, pack','<h2>Przesyłki i zwroty</h2>\n<h3>Twoja przesyłka paczki</h3>\n<p class=\"tw-data-text tw-text-large tw-ta\" id=\"tw-target-text\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\">Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.</span></p>\n<p class=\"tw-data-text tw-text-large tw-ta\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\">Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy szczególnej staranności, aby chronić delikatne przedmioty.</span></p>\n<p class=\"tw-data-text tw-text-large tw-ta\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\">Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</span></p>','dostawa'),(2,1,1,'Nota prawna','','Legal notice','','<h2>Nota prawna</h2>\n<h3>Słowa uznania</h3>\n<p>Koncept i produkcja:</p>\n<p>Ta strona internetowa została stworzona przy użyciu otwartego oprogramowania <a href=\"http://www.prestashop.com\">PrestaShop</a>™.</p>','nota-prawna'),(3,1,1,'Zasady i warunki użytkowania','','Zasady i warunki użytkowania','conditions, terms, use, sell','<h2>Zasady i warunki użytkowania</h2>\n<h3>Zasada 1</h3>\n<p>Tutaj znajduje się zawartość zasady 1</p>\n<h3>Zasada 2</h3>\n<p>Tutaj znajduje się zawartość zasady 2</p>\n<h3>Zasada 3</h3>\n<p>Tutaj znajduje się zawartość zasady 3</p>','zasady-i-warunki-uzytkowania'),(4,1,1,'O nas','O nas','Dowiedz się więcej o nas','o nas','<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>Ćmy lampy</p>\n<h3>Nasza drużyna</h3>\n<p>Jakub Nowak</p>\n<p>Przemysław Rośleń</p>\n<p>Jakub Sachajko</p>\n<p>Wiktor Krasik</p>','o-nas'),(5,1,1,'Bezpieczna płatność','','Nasz bezpieczny sposób płatności','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczna płatność</h2>\n<h3>Nasza bezpieczna płatność</h3>\n<p>Z SSLem</p>\n<h3>Używając Visa/Mastercard/Paypal</h3>\n<p>O tych serwisach</p>','bezpieczna-platnosc'),(6,1,1,'Menu','','','','','menu');
