INSERT INTO `ps_info_lang` VALUES (1,1,1,'<div>\n<h1 style=\"margin:20px 0px 10px;padding:0px;border:0px;font-size:36px;font-family:\'Regular-r\', sans-serif;font-weight:500;line-height:1.1;color:#080808;text-align:center;\"><span style=\"font-weight:bold;\">Sklep internetowy z oświetleniem - Ćmy lampy<br /></span></h1>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\">Szukasz wyjątkowej lampy? Interesuje Cię oryginalne oświetlenie, które doda wnętrzom niepowtarzalnego charakteru? Jesteś we właściwym miejscu! Nasz <span style=\"font-weight:bold;\">internetowy sklep z lampami </span>oraz nowoczesnymi rozwiązaniami w zakresie oświetlenia domu i ogrodu to <span style=\"font-weight:bold;\">najlepszy asortyment dostarczany przez renomowanych producentów</span>.</p>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\"><span style=\"font-weight:bold;\">Proponujemy bogaty wybór lamp idealnych do każdego wnętrza, zawsze w zdecydowanie atrakcyjnych cenach.</span> Każda nasza propozycja to połączenie wysokiej estetyki, oryginalnego designu, funkcjonalności i wygody użytkowania. Energooszczędne oświetlenie LED, lampy wiszące i podłogowe, kinkiety i żyrandole, a także wiele innych propozycji - u nas znajdziesz lampę, jakiej szukasz!</p>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\">Nasz internetowy sklep z nowoczesnym oświetleniem to także <span style=\"font-weight:bold;\">gwarancja wygodnych, bezpiecznych zakupów</span>, które będą dla Ciebie prawdziwą przyjemnością. Dbamy o komfort każdego naszego Klienta!</p>\n<h2 style=\"margin:20px 0px 10px;padding:0px;border:0px;font-family:\'Regular-r\', sans-serif;font-weight:500;line-height:1.1;color:#080808;font-size:30px;text-align:center;\">Oryginalne lampy idealne do każdego wnętrza</h2>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\">Ćmy lampy- internetowy sklep z lampami - to mnóstwo interesujących propozycji w zakresie oświetlenia salonu, jadalni, kuchni, sypialni, łazienki, czy pokoju dziecka. Mamy efektowne i funkcjonalne rozwiązania do każdego wnętrza, niezależnie od jego stylu i aranżacji. Proponowane przez nas lampy zachwycają modnym designem, imponując jednocześnie doborem materiałów oraz jakością. Nasza starannie wyselekcjonowana oferta obejmuje lampy dostarczane przez najlepszych, renomowanych producentów, m.in.: EGLO, PAUL NEUHAUS, LEUCHTEN DIREKT, MARKSLOJD, LEMIR, GLOBO, HONSEL, MASSIVE, ITALUX, CLEONI, AZZARDO, SANNELI DESIGN, ZUMA LINE, MAXLIGHT, REALITY, NOWODVORSKI (dawniej Technolux), PHILIPS, ESEO, MANTRA, LAMPEX, KLIK, SINUS, WOFI, LUMINA DECO, 4CCONCEPTS.</p>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\"><span style=\"font-weight:bold;\">Szeroki asortyment oraz profesjonalna obsługa zamówień dostosowana do indywidualnych potrzeb, spełniają oczekiwania najbardziej wymagających Klientów.</span></p>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\"><span style=\"font-weight:bold;\">..............................................................................</span></p>\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;color:#080808;font-family:\'Regular-r\', sans-serif;font-size:14px;text-align:center;\">Szukasz konkretnej lampy? Nie znalazałes/aś jej w naszej ofercie? Napisz do nas i zapytaj, a my postaramy sie jak najszybciej odpowiedzieć czy taką lampe posiadamy oraz zaproponujemy bardzo atracyjną cenę</p>\n</div>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

