a LOCUS L  5  AZzardo AZ3406 AZ3405 AZ3407 - kolor do wyboru','','','',''),(30,1,1,'<p><strong>Producent: </strong><a href=\"https://www.cudownelampy.pl/milagro.html\" title=\"Milagro\">Milagro</a></p><p>Materiał: metal + kryształ</p>\n<p>Kolor: biały</p>\n<p>Moc: 18W LED (odpowiednik ok 93W)</p>\n<p>Wymienny moduł led: Tak</p>\n<p>Strumień świetlny: 1260 Lm</p>\n<p>Wysokość: max 100 cm</p>\n<p>Średnica: 35 cm</p>\n<p>Barwa światła: neutralna 4000K</p>\n<p>Do wykonania lampy LUX BIANCO 860 użyto bezpiecznego i trwałego metalu oraz kryształów. Model ten ma jeden punkt świetlny LED, która można wymienić. Daje on światło o neutralnej barwie, korzystnej dla oka. Jego temperatura barwowa wynosi 4000 K, a jasność plasuje się na poziomie 1260 lumenów. Maksymalna moc tego modelu wynosi 18 W, co odpowiada 93 W w żarowym źródle światła. Wartość napięcia znamionowego jest z kolei równa 230 V. Lampa ma regulowaną wysokość całkowitą. Licząc od sufitu może się ona wahać od 60 cm do 100 cm. Szerokość lampy wynosi z kolei 35 cm. Natomiast podsufitka jest wysoka na 6 cm, a jej średnica ma 16 cm.</p>\n<p>Lampa wisząca z linii LUX BIANCO 860 przyciągnie wzrok w każdym pomieszczeniu. Okrągła oprawa w białym kolorze i wynurzające się z niej kryształki dodadzą blasku nawet prosto urządzonemu wnętrzu. Model ten może być samodzielnym źródłem światła, ale można go również łączyć z innymi lampami z kolekcji LUX BIANCO.</p>','','lampa-wiszaca-lux-bianco-milagro-ml860','','','','Lampa wisząca LUX BIANCO Milagro ML860','','','',''),(31,1,1,'<p><strong>Produkt:</strong> Lampa wisząca MIB firmy NORDLUX 71673001</p>\n<p>Kolor: biały</p>\n<p><strong>Wykonanie:</strong> Metal</p>\n<p><strong>Źródło światła:</strong> 1 x GU10 4W - w komplecie</p>\n<p><strong>Wymiary:</strong></p>\n<p>Wysokość: max 150 cm</p>\n<p>Średnica klosza: 6 cm</p>\n<p>Długość klosza: 20 cm</p>\n<p><strong>Nowa, w oryginalnym opakowaniu</strong></p>\n<p>W ofercie CudowneLampy.pl znajdziecie Państwo <a href=\"lampy-wiszace.html\