0 przyciągnie wzrok w każdym pomieszczeniu. Okrągła oprawa w białym kolorze i wynurzające się z niej kryształki dodadzą blasku nawet prosto urządzonemu wnętrzu. Model ten może być samodzielnym źródłem światła, ale można go również łączyć z innymi lampami z kolekcji LUX BIANCO.</p>','','lampa-wiszaca-lux-bianco-milagro-ml860','','','','Lampa wisząca LUX BIANCO Milagro ML860','','','',''),(317,1,1,'<p><strong>Produkt:</strong> Lampa wisząca MIB firmy NORDLUX 71673001</p>\n<p>Kolor: biały</p>\n<p><strong>Wykonanie:</strong> Metal</p>\n<p><strong>Źródło światła:</strong> 1 x GU10 4W - w komplecie</p>\n<p><strong>Wymiary:</strong></p>\n<p>Wysokość: max 150 cm</p>\n<p>Średnica klosza: 6 cm</p>\n<p>Długość klosza: 20 cm</p>\n<p><strong>Nowa, w oryginalnym opakowaniu</strong></p>\n<p>W ofercie CudowneLampy.pl znajdziecie Państwo <a href=\"lampy-wiszace.html\">nowoczesne lampy</a>, najmodniejsze wzory i nakorzystniejsze ceny!</p>','','lampa-wiszaca-mib-led-nordlux-71673001-biala','','','','Lampa wisząca MIB LED Nordlux 71673001 biała','','','',''),(318,1,1,'<p><strong>Producent: </strong><a href=\"https://www.cudownelampy.pl/paul-neuhaus.html\" title=\"Paul Neuhaus\">Paul Neuhaus</a></p><p><strong>Wykonanie:</strong> aluminium, akryl</p>\n<p><strong>Kolor:</strong> aluminium</p>\n<p><strong>Źródło światła:</strong> zintegrowany LED 45W</p>\n<p>Lumen: 2085 lm</p>\n<p>Klasa energetyczna: A+</p>\n<p>Barwa: 2700-5000K</p>\n<p><strong>Wymiary:</strong></p>\n<p>Szerokość: regulowana od 120 cm do 179 cm</p>\n<p>Szerokość: 5,5 cm</p>\n<p>Wysokość: max 180 cm</p>\n<p><strong>Lampa posiada możliwość zmiany barwy światła, ściemniania oraz włączania i wyłączania za pomocą przycisków znajdujących się na środku belki</strong></p>','','lampa-wiszaca-rozsuwana-120cm-179cm-adriana-led-paul-neuhaus-2568-95-ze-sciemniaczem','','','','Lampa wisząca rozsuwana 120cm 179cm ADRIANA LED Paul Neuhaus 2568-95 ze ściemniaczem','','','',''),(319,1,1,'<p><strong>Producent: </strong><a href=\"https://www.